			</ol>
		
	<p>Підсвічування союзників, а також карта місцевості та облік боєприпасів — усі ці дані тепер будуть перед очима гравця. Із цим гаджетом геймеру буде ще складніше відрізняти віртуальну реальність від її «аналогової» копії. ПРАЦЮЮТЬ РОБОТИ Надійний і безвідмовний домашній помічник, який поєднує в собі функції секретаря, охоронця та навіть аніматора — непоганий спосіб трохи розвантажити себе від побутових щоденних завдань.</p>
<p>Крім цього, симпатичний робот може працювати голосовим секретарем, домашнім фотографом і відеооператором, відтворювати аудіо й транслювати навчальні програми для дітей. Але й це ще не все. Якщо під час вашої відсутності станеться нещасний випадок, Zenbo повідомить про це всіх, кого внесено до його списку відповідальних осіб. Наприклад, отримавши повідомлення про падіння людини, користувач зможе взяти робота під контроль і за допомогою відеокамери детальніше вивчити обстановку. Є такі пристрої, які потрібні нечасто, але вже якщо знадобляться, то краще мати їх під рукою.</p>
<p>Один з них — звичайний градусник, який не зустрiнеш серед речей щоденного користування. Кому охота носити із собою в сумці тендітну скляну колбу з ртуттю? Розумний термометр Withings Thermo завдяки 16 інфрачервоним датчикам може виміряти температуру тіла одним дотиком до чола. Портативний пристрій являє собою невеликий білий циліндр, з одного кінця якого розташована сенсорна панель, що збирає дані.</p><strong><a id='t2'></a><h2>Суд скасував заборону серіалу "Свати" і дозволив в'їзд в Україну російському акторові Добронравову</h2></strong><p>Збоку знаходиться екран, на який виводяться результати за шкалою Цельсія або Фаренгейта. Процедура вимірювання температури займає дві секунди, протягом яких Withings Thermo робить до  вимірювань, включаючи температуру навколишнього середовища та тіла пацієнта. ТЕРИТОРІЯ КОНТРАСТУ Полтавщина — один з небагатьох регіонів України, де рівною мірою представлені майже всі галузі економіки.</p>
<p>Однак через кризу та велику залежність від російського ринку ця область постраждала чи не найсильніше в країні. Київський вокзал у Полтаві, куди прибувають прямуючі зі столиці потяги, — хлібне місце для таксистів: звідси до центру міста дістатися громадським транспортом можна лише тролейбусом або дублюючою його маршруткою.</p><strong><a id='t3'></a><h2>В Украине запретили сериал "Сваты"</h2></strong><p>При цьому вони ще й ходять з півгодинним інтервалом, що аж ніяк не можна назвати зручним розкладом. Про такі нюанси логістики кореспондент Intercity Magazine дізналася, коли найспритніші таксисти розібрали клієнтів і привокзальна площа спорожніла… Тому домовлятися довелося з власником стареньких «Жигулів» — за 20 гривень він відвіз мене до центру й навіть влаштував невеличку. Двадцять гривень для нього — неабиякі гроші.</p>
<p>Візництвом тут заробляти непросто, бо через безробіття багато місцевих жителів йдуть працювати приватними перевізниками. РЕЛЬЄФ ЕКОНОМІКИ Пошук роботи — найактуальніша тема в Полтаві та області. Розмови про це точаться у кафе та в громадському транспорті, це питання піднімали практично всі полтавські співрозмовники Intercity Magazine. Кілька років тому зарплатня у  гривень вважалася доброю, а що зараз можна купити на ці гроші? Але розводить руками, бо не в змозі переглядати зарплати відповідно до реальної інфляції.</p>
<p>Він багато розповідає про кризу та важливість російського ринку для Полтавщини. Це й не дивно, бо саме цей ринок протягом довгих років тримав дві найважливіші галузі Полтавщини: харчову промисловість та машинобудування. того ж через кризу та падіння платоспроможності українці стали менше витрачати на продукти. І компаній з подібними проблемами на Полтавщині чимало. ПРИХОВАНІ РЕСУРСИ Велику роль в економіці Полтавського регіону відіграє добувна промисловість. Розвідані запаси природного газу складають  млрд куб. м, нафти — більш  млн т, газового конденсату — понад  млн т.</p>
<p>Окрім того, область вважається перспективною з точки зору видобування сланцевого газу — його запаси в регіоні оцінюються майже у 1,9 трлн кубометрів. Тут розташований один з найбільших НПЗ в Україні — Кременчуцький. Однак за. виробництва області займає третє місце після видобувної та нафтопереробної.</p><a id='t4'></a><h3>Перший державний драматичний театр, заснований 1918 року в Києві</h3><p>Значне падіння виробництва демонструють й інші машинобудівні підприємства регіону. Єдине підприємство Полтавщини у галузі машинобудування, яке майже не відчуло кризи, — це КБ «Аерокоптер», де виробляють двомісні гелікоптери. Воно не залежить від вітчизняного та російського ринків — основні замовлення надходять з ОАЕ, Китаю, Південної Кореї та ЄС.</p>
<p>У цих країнах полтавський виробник гвинтокрилої техніки давно має власних дилерів. Й це при тому що за цей період обсяги випущеної продукції збільшилися майже вдвічі. Однак у гірничодобувної галузі митне навантаження не призвело до скорочення обсягів виробництва. А це — головна галузь у структурі промислового виробництва Полтавської області.</p>
<p>Це найкращий показник не лише серед аналогічних підприємств України, а й ГЗК на просторі колишнього СРСР.</p><img src="https://image.isu.pub/150904123053-8e0011f7fa0e7bc96ef67ea1f9aec797/jpg/page_1.jpg" alt="" style="max-width: 480px; max-height: 480px;"/><p>Економічну міцність області посилює й легка промисловість. У регіоні понад 40 швейних підприємств без урахування невеликих цехів і ательє. У Полтавській області шиють усе: від виробів зі шкіри до постільної білизни та дитячого одягу. Й левова частка товарів йде на експорт — полтавські швейні фабрики воліють якнайбільше продукції продавати за валюту. Однак усе це не може перекрити загальне падіння зовнішніх поставок. МОДНІ ТРЕНДИ Як збирається вирішувати ці проблема місцева влада? Але судячи зі Стратегії розвитку Полтавської області на період до  року — офіційного документа, розробленого за підтримки ЕС представниками місцевої ОДА, ставка робиться на аграрний напрямок.</p>
<p>З 25 районів Полтавського області півтора десятка мають аграрну специфіку, в регіоні — 2,1 млн га сільськогосподарських угідь, це майже. До того ж тут найбільші в країні посівні площі сої та кукурудзи. З року в рік область займає одне з перших місць в Україні за валовим збором зерна та цукросировини. Крім того, є річковий порт, який у перспективі аграрії могли б використовувати для своїх потреб. Але як цей напрямок розвиватиметься поряд із видобувною промисловістю? Однак із часом владі все одно доведеться вирішувати це питання.</p>
<p>Розробники Стратегії значне місце відводять туризму. Проте незрозуміло, що саме влада збирається робити для його розвитку. Однак потрібно займатися ремонтом доріг, комунальних мереж та сприяти популяризації регіону… Поки що місцевій владі це не дуже добре вдається.</p>
		
	<p>Напій найвищої якості незабаром став найдефіцитнішим ігристим у СРСР і розходився в основному серед партійної номенклатури. Зараз «Артвайнері» — визнаний на світовому ринку український виробник ігристого вина, який дотримується стандартів класичної пляшкової шампанізації з використанням найсучаснішого обладнання.</p>
</p>
